import EmployeeDetails from './Components/EmplyeeDetails';
import AddEmployeeDetails from './Components/AddEmplyoyeeDetails';
import SearchEmployee from './Components/SearchEmployee';

const App = () => {
  return (
    <div>
      <EmployeeDetails />
      <AddEmployeeDetails />
      <SearchEmployee />
    </div>
  );
}

export default App;
